mapper.select:

select

from _submission
where 1 = 1

  AND submission_id = #{submissionId,jdbcType=INTEGER}


  AND problem_id = #{problemId,jdbcType=INTEGER}


  AND contest_id = #{contestId,jdbcType=INTEGER}


  AND contest_num = #{contestNum,jdbcType=VARCHAR}


  AND user_id = #{userId,jdbcType=INTEGER}


  AND user_name = #{userName,jdbcType=VARCHAR}


  AND result = #{result,jdbcType=SMALLINT}


  AND time = #{time,jdbcType=INTEGER}


  AND memory = #{memory,jdbcType=INTEGER}


  AND submit_time = #{submitTime,jdbcType=TIMESTAMP}


  AND language = #{language,jdbcType=INTEGER}


  AND open = #{open,jdbcType=SMALLINT}


  AND disp_language = #{dispLanguage,jdbcType=VARCHAR}


  AND status_canonical = #{statusCanonical,jdbcType=VARCHAR}


  AND source_length = #{sourceLength,jdbcType=INTEGER}


  AND valid = #{valid,jdbcType=TINYINT}


  AND judge_type = #{judgeType,jdbcType=TINYINT}


  AND judge_time = #{judgeTime,jdbcType=TIMESTAMP}


  AND pass_rate = #{passRate,jdbcType=DECIMAL}


  AND judger = #{judger,jdbcType=CHAR}


  AND add_datetime = #{addDatetime,jdbcType=TIMESTAMP}


  AND update_datetime = #{updateDatetime,jdbcType=TIMESTAMP}


  AND del = #{del,jdbcType=INTEGER}

ORDER BY submission_id desc
